import React, { Component } from 'react';
import ContactForm from './Components/Contact';
import './App.css';

class App extends Component {
  addToList = (contact) =>{
    console.log(contact);
  }

  render() {
    return (
      <div className="App">
        <div style={{width:600, margin: "0 auto",textAlign: "left", padding:"2", backgroundColor:"#fff"}}>
        <ContactForm addToList={this.addToList}/>
        </div>
      </div>
    );
  }
}

export default App;
